// Tooltips
$_MODULE['<{videodesk}prestashop>home-login_a8a051fa0c4788320dcf273106bea09b'] = 'Acerca del sitio web ID';
$_MODULE['<{videodesk}prestashop>home-login_92faf6fecac3ab43f364cf47a530cfce'] = 'Si ya eres registrado en VideoDesk, puedes vincular tu cuenta existente con tu sitio web PrestaShop: copiar y pegar tu Videodesk Sitio web ID aquí, hace un clic en el botón "Registrar". El Videodesk Sitio web ID es un texto en el formato "32 dígitos - 10 dígitos" que aparece en tu back office VideoDesk (en el menú "Sitios web")';
$_MODULE['<{videodesk}prestashop>home_a8a051fa0c4788320dcf273106bea09b'] = 'Acerca del sitio web ID';
$_MODULE['<{videodesk}prestashop>home_92faf6fecac3ab43f364cf47a530cfce'] = 'Si ya eres registrado en VideoDesk, puedes vincular tu cuenta existente con tu sitio web PrestaShop: copiar y pegar tu Videodesk Sitio web ID aquí, hace un clic en el botón "Registrar". El Videodesk Sitio web ID es un texto en el formato "32 dígitos - 10 dígitos" que aparece en tu back office VideoDesk (en el menú "Sitios web")';
$_MODULE['<{videodesk}prestashop>signup-step-2_6bdb86165fd72891ee2c404c5a864759'] = 'Elegir los asesores';
$_MODULE['<{videodesk}prestashop>signup-step-2_784f0e6625fad31f23ed174aee8b4d59'] = 'Cada asesor necesita una cuenta para estar disponible en VideoDesk y chatear con su clientes. VideoDesk puede importar algunas cuentas de sus empleados para simplificar la creación de las cuentas Videodesk. Seleccione en la parte de abajo los empleados que utilizarán Videodesk (si tiene varios sitios web, puede elegir en qué sitio(s) cada agente podrá interactuar), a continuación, haga clic en el botón "Importar". En la página siguiente, todas las informaciones (nombres, direcciones de correo electrónico, idiomas, etc.) de los empleados seleccionados serán automáticamente completadas en el formulario de creación de cuentas. Usted sólo tendrá que comprobar los datos y validar (usted será capaz de cambiar y/o de validar antes de enviarlas a VideoDesk).';
$_MODULE['<{videodesk}prestashop>shop-configuration_03d983ebaa3bfc62c0c94434acae4173'] = 'Visualización de Videodesk ';
$_MODULE['<{videodesk}prestashop>shop-configuration_bd6a1a8eb02b291633fca0607bd6daad'] = 'Marca la opción  "Mostrar" si desea mostrar Videodesk en su tienda. Puede restringir la visualización de Videodesk a una sola dirección IP y de este modo, solamente usted podrá ver Videodesk (por ejemplo, para las pruebas). Si no conoce su dirección IP, utilice herramientas en línea gratis como www.tracemyip.org ou www.whatismyip.com. Marque "Ocultar" si desea ocultar permanentemente Videodesk en su tienda.';
$_MODULE['<{videodesk}prestashop>shop-configuration_01e6576a9d2c3b72e757b056516ccb57'] = 'Configurar los criterios de visualización de Videodesk';
$_MODULE['<{videodesk}prestashop>shop-configuration_6396bbda72c28e385bab761e0d33a677'] = 'Usted puede elegir visualizar siempre Videodesk (seleccione "Siempre visualizar") o sólo cuando se cumplen los criterios (seleccione opción "Si una o la totalidad de las reglas siguientes se cumplen"). Para establecer los criterios, seleccione si todas las reglas deben cumplirse (seleccione opción "la totalidad") o si una regla es suficiente para mostrar Videodesk (seleccione la opción "una"), a continuación, seleccione 1 de las 5 reglas.';
$_MODULE['<{videodesk}prestashop>shop-configuration_abd8762ed74699e257a7c1f82e117c43'] = 'Perímetro de visualización de Videodesk';
$_MODULE['<{videodesk}prestashop>shop-configuration_1d69f19ad9e9f2a448233ba5d31461ae'] = 'Usted puede optar por mostrar Videodesk en todas las páginas de su tienda (seleccione opción "Todas las páginas") o mostrar Videodesk en las páginas seleccionadas (seleccione opción "Las páginas siguientes:" y marca debajo las páginas donde se mostrará Videodesk)';
$_MODULE['<{videodesk}prestashop>shop-configuration_6887a4708b211174e4f24e4586ad6b48'] = 'Estadística';
$_MODULE['<{videodesk}prestashop>shop-configuration_dc82396da06505c832738ab79f4f496a'] = 'Las estadísticas le permiten...';

